import React from 'react';
import "../css/Page.css"
import PokemonZoo from '../components/PokemonZoo';
import { useEffect } from 'react';

export const Home = () => {

  useEffect(() => {
    window.location.reload();
  }, [])

  return (
    <>
      <div class="mainContainer">
        <PokemonZoo />
      </div>
    </>
  )
};

export default Home;
